import React from 'react';
import './Calendar.css';

function Calender() {
  return (
    <div>
      <div className='calendar-container'>
        <div className='calendar-inner-container'>
          <h2>Calender</h2>
        </div>
      </div>
    </div>
  )
}

export default Calender
